  background-size: cover;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}

.name {
  font-size: 60px;
}

.info {
  color: white;
  margin: 0px;
}

.btn-container {
  display: flex;
  width: 60%;
  flex-direction: row;
  justify-content: space-between;
  margin-top: 20px;
}
`;

